def kmer_counting_error_val(seq, k, upper_bound):
    res = [0.0] * len(seq)
    kmer_pos = {}
    for i in range(len(seq) - k + 1):
        kmer = seq[i:i + k]
        if kmer not in kmer_pos:
            kmer_pos[kmer] = list()
        kmer_pos[kmer].append(i)
    for kmer in kmer_pos.keys():
        if len(kmer_pos[kmer]) > upper_bound:
            for start in kmer_pos[kmer]:
                res[start:start + len(kmer)] = [1.0 * len(kmer_pos[kmer]) - upper_bound] * len(kmer)
    return res


def kmer_counting(seq, k, upper_bound):
    return max(kmer_counting_error_val(seq, k, upper_bound)) > 0.0


if __name__ == "__main__":
    print(kmer_counting_error_val(
        "",
        20, 50))
    print(kmer_counting("ACGTACGTACGTACGTACGTACGTACGTACGTACGTACGT", 20, 2))
    print(kmer_counting_error_val("ACGTAAACGTACGTACGGGTACGTGTACGTACGTAAAACGTACGTACGT", 20, 2))
    print(len("ACGTACGTACGTACGTACGTACGTACGTAAAACGTACGTACGT"))
